(()=>{"use strict";const updateIncludes=async()=>{const t=document.querySelectorAll("include"),e=new Map,r=Array.from(t).map((async t=>{const r=t.getAttribute("location"),n=JSON.parse(t.getAttribute("args")||"{}");try{let o=await(async t=>{if(e.has(t))return e.get(t);const r=await fetch(t);if(!r.ok)throw new Error(`Network response was not ok: ${r.status}`);const n=await r.text();return e.set(t,n),n})(r);for(const t in n)o=o.replaceAll(`*${t}`,n[t]);t.innerHTML=o;t.querySelectorAll("script").forEach((t=>{const e=document.createElement("script");e.textContent=t.textContent,document.head.appendChild(e).parentNode.removeChild(e)}))}catch(t){console.error("Error fetching data:",t)}}));await Promise.all(r)};updateIncludes()})();